import React from 'react';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBIcon,
  MDBCheckbox,
  MDBTabsLink,
  MDBCardLink,
  MDBNavbarLink
}
from 'mdb-react-ui-kit';
import { Button } from 'reactstrap';
import '../styles/Login.css';
import { Link } from 'react-router-dom';
function Login() {
  return (
    <MDBContainer fluid>

      <MDBRow className='d-flex justify-content-center align-items-center h-100'>
        <MDBCol col='12'>

          <MDBCard className='bg-white my-5 mx-auto' style={{borderRadius: '1rem', maxWidth: '500px'}}>
            <MDBCardBody className='p-5 w-100 d-flex flex-column'>

              <h2 className="fw-bold mb-2 text-center">Sign in</h2>
              <p className="text-white-50 mb-3">Please enter your login and password!</p>

              <MDBInput wrapperClass='mb-4 w-100' label='Email address' id='formControlLg' type='email' size="lg"/>
              <MDBInput wrapperClass='mb-4 w-100' label='Password' id='formControlLg' type='password' size="lg"/>

              <MDBCheckbox className="mb-3" name='flexCheck' id='flexCheckDefault' className='mb-4' label='Remember password' />

                <MDBNavbarLink>Forgot Password ? </MDBNavbarLink>


              <button className="LoginRegisterButton text-white btn-lg">Login</button>

               <Link  to="/register">Sign Up </Link>

            </MDBCardBody>
          </MDBCard>

        </MDBCol>
      </MDBRow>

    </MDBContainer>
  );
}

export default Login;
